#include<stdio.h>
#include<vector>
#include<string>
using namespace std;
vector<int> parse_nested_parens(string paren_string){
    vector<int> depths;
    int current_depth = 0;
    for (char c : paren_string) {
        if (c == '(') {
            current_depth++;
            depths.push_back(current_depth);
        } else if (c == ')') {
            depths.push_back(current_depth);
            current_depth--;
        }
    }
    vector<int> max_depths;
