double find_zero(vector<double> xs){
    double x = 0.0;
    if (xs.size() % 2 != 0) {
        throw std::invalid_argument("Number of coefficients should be even.");
    }
    double largestNonZeroCoefficient = 0.0;
    for (double coeff : xs) {
