#include<stdio.h>
#include<vector>
using namespace std;
vector<int> pluck(vector<int> arr){
    vector<int> result = {};
    int smallestEven = INT_MAX;
    int smallestIndex = INT_MAX;

    for (int i = 0; i < arr.size(); i++) {
        if (arr[i] % 2 == 0 && arr[i] < smallestEven) {
            smallestEven = arr[i];
            smallestIndex = i;
        } else if (arr[i] % 2 == 0 && arr[i] == smallestEven && i < smallestIndex) {
            smallestIndex = i;
        }
    }

    if (smallestEven != INT_MAX && smallestIndex != INT_MAX) {
        result.push_back(smallestEven);
        result.push_back(smallestIndex);
    }

    return result;
}

