bool will_it_fly(vector<int> q, int w) {
    // Check if the vector is palindromic
    bool isPalindromic = true;
    for (int i = 0; i < q.size() / 2; i++) {
        if (q[i] != q[q.size() - i - 1]) {
            isPalindromic = false;
            break;
        }
