    int i = 0;
    while (i < S.size()) {
        if (S[i] == 'I' && (i == 0 || S[i - 1] == '.' || S[i - 1] == '?' || S[i - 1] == '!')) {
            count++;
        }
        i++;
    }
    return count;
}

