bool check_dict_case(map<string,string> dict){
    if(dict.empty()){
        return false;
    }
    for(auto const& element : dict) {
        string key = element.first;
        for(char c : key) {
            if(!isalpha(c)) {
                return false;
            }
        }
        bool isLower = all_of(key.begin(), key.end(), ::islower);
        bool isUpper = all_of(key.begin(), key.end(), ::isupper);
