bool move_one_ball(vector<int> arr){
    if (arr.empty()) {
        return true;
    }
    int n = arr.size();
    int minIndex = -1;
    for (int i = 0; i < n; i++) {
        if (minIndex == -1 || arr[i] < arr[minIndex]) {
            minIndex = i;
        }
    }
    for (int i = 0; i < n; i++) {
        if (arr[(minIndex + i) % n] != i + 1) {
            return false;
        }
    }
    return true;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (move_one_ball({3, 4, 5, 1, 2})==true);
    assert (move_one_ball({3, 5, 10, 1, 2})==true);
    assert (move_one_ball({4, 3, 1, 2})==false);
    assert (move_one_ball({3, 5, 4, 1, 2})==false);
    assert (move_one_ball({})==true);
}

