#include<stdio.h>
#include<vector>
using namespace std;
int max_fill(vector<vector<int>> grid, int capacity) {
    int numFillOperations = 0;
    for (int j = 0; j < grid[0].size(); j++) {
        int waterLevel = 0;
        for (int i = 0; i < grid.size(); i++) {
            if (grid[i][j] == 1) {
                if (waterLevel > 0) {
                    int bucketsNeeded = waterLevel / capacity;
                    if (waterLevel % capacity != 0) {
                        bucketsNeeded++;
                    }
                    numFillOperations += bucketsNeeded;
                    waterLevel = 0;
                }
            } else {
                waterLevel++;
            }
        }
        if (waterLevel > 0) {
            int bucketsNeeded = waterLevel / capacity;
            if (waterLevel % capacity != 0) {
                bucketsNeeded++;
            }
            numFillOperations += bucketsNeeded;
        }
    }
    return numFillOperations;
}

