using namespace std;
int max_fill(vector<vector<int>> grid, int capacity) {
    int numFillOperations = 0;
    int rows = grid.size();
    int cols = grid[0].size();

    for (int j = 0; j < cols; j++) {
        int waterInColumn = 0;
        for (int i = 0; i < rows; i++) {
            waterInColumn += grid[i][j];
        }
