#include<stdio.h>
#include<string>
using namespace std;
string solve(string s){
    int n = s.size();
    int i = 0, j = n - 1;
    while (i < j) {
        if (isalpha(s[i]) && isalpha(s[j])) {
            s[i] = islower(s[i]) ? toupper(s[i]) : tolower(s[i]);
            s[j] = islower(s[j]) ? toupper(s[j]) : tolower(s[j]);
            i++;
            j--;
        } else if (isalpha(s[i])) {
            j--;
        } else if (isalpha(s[j])) {
            i++;
        } else {
            char temp = s[i];
            s[i] = s[j];
            s[j] = temp;
            i++;
            j--;
        }
    }
    if (i == j && isalpha(s[i])) {
        s[i] = islower(s[i]) ? toupper(s[i]) : tolower(s[i]);
    }
    return s;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (solve("AsDf") == "aSdF");
    assert (solve("1234") == "4321");
    assert (solve("ab") == "AB");
    assert (solve("#a@C") == "#A@c");
    assert (solve("#AsdfW^45") == "#aSDFw^45");
    assert (solve("#6@2") == "2@6#");
    assert (solve("#$a^D") == "#$A^d");
    assert (solve("#ccc") == "#CCC");
}

